/* Buttons allgemein */
.ff-el-form-check-label {
    border: 1px solid #f44952 !important;
    border-radius: 0 !important;
    color: #f44952 !important;
    background-color: transparent !important;
}
.ff-el-form-check-label {
    margin-right: 3px !important;
    margin-bottom: 3px !important;
}
.fluentform .ff-el-group.ff_list_buttons .ff-el-form-check.ff_item_selected label > span {
    background-color: #f44952 !important;
    border-color: #f44952 !important;
    border-radius: 0 !important;
    box-shadow: none !important;
    color: #ffffff !important; /* weisse Schrift */
}
.fluentform .ff-el-group.ff_list_buttons .ff-el-form-check label>span:hover {
    color: #000000 !important;
}
.fluentform .ff-el-group.ff_list_buttons .ff-el-form-check label:focus-within span {
    background-color: #ffffff
}

.ff-el-progress-status {
    display: none !important;
}

.fluentform .ff-el-group.ff_list_buttons .ff-el-form-check {
    margin:0 0 2px;
}

@media only screen and (max-width: 768px) {
    .fluentform .ff-el-group.ff_list_buttons .ff-el-form-check {
        display:inline !important;
        width: 100%
    }

    .fluentform .ff-el-group.ff_list_buttons .ff-el-form-check label>span {
        border: 0px solid!important;
        border-radius: 0px!important;
        box-shadow: none!important;
        display: block;
        width: 100%
    }
}

@media only screen and (min-width: 768px) {
    .ff-el-form-control.textfeld {
        width: 50% !important;
    }
    .ff-el-form-control.textfelddetails {
        width: 50% !important;
    }
    .ff-el-group.ff-el-form-top.keller-dachboden.ff_list_buttons {
        margin-bottom: 15px !important;
    }
}
.ff-el-form-control.textfeldanzahl {
    width: 80px !important;
}
.ff-el-form-control.textfeldkurz {
    width: 150px !important;
}

.ff-btn.ff-btn-submit.ff-btn-md.ff_btn_style.wpf_has_custom_css {
    background: #f44952 !important;
}


.bilder-beschreibung {
    margin-top: -15px !important;
}

.ff-el-group.dsgvo.has-conditions.ff-el-input--content.ff_cond_v > .ff-el-form-check.ff-el-tc > .ff-el-form-check-label.ff_tc_label {
    color: #000000 !important;
    border: none !important;
    font-size: 14px !important;
    line-height: 1.4em !important;
}

.dsgvo {
    color: #000000 !important;
