    const activeLang = document.querySelector('.wpml-ls-current-language');
    if (activeLang) {
        if (activeLang.classList.contains('wpml-ls-item-en')) return 'en';
        if (activeLang.classList.contains('wpml-ls-item-fr')) return 'fr';
        if (activeLang.classList.contains('wpml-ls-item-it')) return 'it';
